■写真やハガキ印刷等の通常使用に安心してご使用いただけます。<br>
■エコマーク新基準「再生インクカートリッジ」の承認第1号です。<br><br>

サイズ：パッケージ<br>
W95×D118×H24(mm)<br><br>

対応機種 : DCP-165C/385C/390CN/535CN/595CN/490CN/495CN/670CD/670CDW/675CD/675CDW
MFC-675CDW/695CDN/695CDWN/735CD/735CDW/930CDN/930CDWN/935CDN/935CSWN
MFC-5890CN/6490CN/6890CN/515N/615N/715N/J850DN/DWN,J800D/DW,J950DN/DWN,J700D/DW<br><br>

使用上の注意<br>
●ご使用になるまでは、開封しないでください。<br>
●お子様の手の届かない場所に保管してください。<br>直射日光を避け室温（40℃以下）で保管してください。<br>
●インクが肌についた時は、素早く水で洗浄してください。<br>一度セットしたカートリッジは交換時以外は取り外さないでください。<br>
●開封後6ヶ月以内に使い切ってください。<br>
●最適な画質を得るため、当カートリッジとの組み合わせ使用は、純正品およびエコリカ・リサイクル品を推奨します（印字検証済です）。<br>
●その他のメーカー品との組み合わせ使用につきましてはお避けください。<style type="text/css">
/*買い物かごに入れるボタン*/
div#rakutenLimitedId_aroundCart input.rCartBtn, 
div#rakutenLimitedId_aroundCart input.rCartBtn[type="submit"] {
    width: 315px !important;
    height: 102px !important;
    cursor: pointer !important;
    background: url("http://image.rakuten.co.jp/3rsystem/cabinet/kihon/icon/imgrc0068736584.jpg")no-repeat 0 0 !important;
}

div#rakutenLimitedId_aroundCart input.rCartBtn,
div#rakutenLimitedId_aroundCart input.rCartBtn[type="submit"]:hover {
    background: url("http://image.rakuten.co.jp/3rsystem/cabinet/kihon/icon/imgrc0068736583.jpg")no-repeat 0 0 !important;
