    color: #333 !important;
    font-weight: bold;
    font-size: 80% !important;
    line-height: 30px;
    display: inline-block;
    margin-right: 16px;
}
body div#rakutenLimitedId_aroundCart input.rCartBtn, body div#rakutenLimitedId_aroundCart input.rCartBtn[type="submit"]{
        background: url("http://image.rakuten.co.jp/ogaria/cabinet/btn.jpg") left top no-repeat;
        width: 240px; /*幅*/
